import React from 'react';

const AdministrarUsuarios = () => {
    return (

      <table className="table table-striped">
          <thead>
              <tr>
                <th scope="col">ID</th>
                <th scope="col">Name</th>
                <th scope="col">Email</th>
                <th scope="col">Created</th>
              </tr>
          </thead>
          <tbody>
              
          </tbody>
      </table>
       
      );
}
 
export default AdministrarUsuarios;
